transforms.result:
.frontLayout {
  background-color: rgb(247, 214, 224, 0.3);
  min-height: 200vh;
}
.pcNav {
  &.active {
    border-bottom: 4px solid $secondary;
  }
  &:hover {
    &:hover::before {
      content: '';
      width: 60px;
      height: 60px;
      position: absolute;
      background: $primary;
      border-radius: 50%;
      z-index: -1;
      left: 50%;
      top: 50%;
      transform: translate(-50%, -50%);
    }
  }
}
